console.log("感谢你的使用");
(function() {
    'use strict';
    const answerDelay = 2000;
    //下面题库请勿修改
    var encodedString = "";
    var decodedString = atob(encodedString);
    var utf8String = decodeURIComponent(escape(decodedString));  
    //下面是代码
    function autoAnswer() {
        const allMatchedElements = document.querySelectorAll('span.question-card.do-question-index');
        const firstTenElements = Array.from(allMatchedElements).slice(0, allMatchedElements.length);
        const totalElements = allMatchedElements.length;
        console.log(`总数: ${totalElements}`);

        firstTenElements.forEach((element, index) => {
            setTimeout(() => {
                const divElement = document.querySelector('.question-content.auto-line');
                const textContent = divElement.textContent;
                console.log(textContent)
                var regex = new RegExp(textContent.replace(/\(/g, '\\(').replace(/\)/g, '\\)') + "<br>\\s*([0-3](?:,[0-3])*)");
                var match = utf8String.match(regex);
                var answer = match ? match[1] : null;
                //console.log(answer);
                var str =answer;
                const checkbox = document.querySelectorAll('.el-checkbox__inner');
                if (checkbox.length !=0){
                    var array = str.split(',');
                    for (var i = 0; i < array.length; i++) {
                        console.log(array[i]);
                        const num = parseInt(array[i]);
                        (function(index) {
                            setTimeout(() => {
                                checkbox[num].click();
                            }, 100 * index);
                        })(i);
                    };}
                else {
                    const singlebox = document.querySelectorAll('.el-radio__inner');
                    console.log(str);
                    setTimeout(() => {
                        singlebox[str].click();
                    }, 100 );
                }
                setTimeout(() => {
                    const button = Array.from(document.querySelectorAll('.el-button')).find(button => button.innerText.includes('确定'));
                    button.click(); console.log(`点击了确定元素`);
                }, 700 );
                setTimeout(() => {
                    const button2 = Array.from(document.querySelectorAll('.el-button')).find(button2 => button2.innerText.includes('下一题'));
                    button2.click();
                    console.log(`点击了下一题元素`);
                }, 1200 );
            }, 3000*index);
        });
    }
    setTimeout(autoAnswer, answerDelay);
})();